import React from 'react'
import './Videos.css'

function Videos(props) {
  const {imagen,color,cambiarImagenVideo,datos} = props

  const enviarVideo=()=>{
     const info={
      "categoria": imagen,
      "titulo": datos.t,
      "video": "https://www.youtube.com/watch?v=30Skd85YjLc",
      "imagen": "https://mooc.ut.ac.ir/lms/auth/joomdle/pluginfile_joomdle.php/2009/course/overviewfiles/front-end.png",
      "descripcion": "aprende a usar lo mas basico de REACK",
      "color":color
     }
     console.log(datos)
  }

  return (
     <img onClick={enviarVideo} style={{border:`4px solid ${color}`}} 
     className='videos' src={imagen} 
     alt='imagen'/>
  )
}

export default Videos
